import React from "react";
import { Button } from "semantic-ui-react";

export default function campaings() {

  const colors=
  {
    border:"inverted",
    borderColor:"blck",
    color : "#800080"
  }

  return (
    <div>
      <Button.Group inverted size="huge" widths="3">
        <Button style={colors}>
          TÜM KAMPANYALAR
        </Button>
        <Button inverted color="red">
          BİRLİKTE AL FIRSATLARI
        </Button>
        <Button inverted color="red">
          CLUB KAMPANYALARI
        </Button>
      </Button.Group>
    </div>
  );
}
